import '../yourProfile.scss'
import { connect } from 'react-redux';
import './auctionManager.scss'
import { getAuctionWithWinnersFromDB } from '../../../utils/auctionUtils';
import React, { useEffect, useState } from "react";

const AuctionResults = (props) => {

    useEffect(() => {
        if (props.currentUser)
            getAuctionWithWinnersFromDB(props.auctionId).then(succ => {
                setProductsList(succ.data.productList);//רשיתמ מוצרים עם הזוכים של מכירה זו
            });
        else window.location = "http://localhost:3000/your_profile";
    }, []);

    let [productsList, setProductsList] = useState([]);

    return (
        <>

            <h1>Chinese auction results</h1>
            {productsList.map((p, index) => {
                if (p.winnerId) return <p key={index}>{p.name}:{p.winnerId.confidentiality ? "Anonymous" : p.winnerId.userName}</p>
            })}
        </>
    );

}

const mapStateToProps = (state) => {
    return {
        auction_id: state.auctionManager.selected_auction_to_options

    };
}
export default connect(mapStateToProps, {})(AuctionResults);
